import React, {Component} from 'react';
import {makeStyles} from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Link from 'next/link';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import PropTypes from 'prop-types';
import CssBaseline from '@material-ui/core/CssBaseline';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import web3 from '../components/web3';

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
        margin: '0 5px'
    },
}));




function ElevationScroll(props) {
    const { children, window } = props;
    // Note that you normally won't need to set the window ref as useScrollTrigger
    // will default to window.
    // This is only being set here because the demo is in an iframe.
    const trigger = useScrollTrigger({
        disableHysteresis: true,
        threshold: 0,
        target: window ? window() : undefined,
    });

    return React.cloneElement(children, {
        elevation: trigger ? 4 : 0,
    });
}







class  ButtonAppBar extends Component {
    constructor(props){
    super(props);
    }
    render(){
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <CssBaseline />
            <ElevationScroll {...props}>
            <AppBar style={{backgroundColor: ' #202020'}}>
                <Toolbar>
                <img src={"https://img.icons8.com/cotton/75/000000/retro-car.png"} alt="Logo" />
                <Typography variant="h4" className={classes.title}>
                   Car Record
                </Typography>
                    <Link href="/index">
                <Button color="inherit">Home</Button>
                    </Link>
                    if(
                    <div>
                    <Link href="/ManageAdmin">
                        <Button color="inherit"> Manage Admin</Button>
                    </Link>
                    </div>
                    <Link href="/ModifyCar">
                    <Button color="inherit">Modify Car</Button>
                    </Link>

                </Toolbar>
            </AppBar>
            </ElevationScroll>
        </div>
    );
}
}

export default ButtonAppBar;
